import React from "react";
class iframe extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      change: true
    };
  }
  componentDidMount() {
    const { change } = this.state;
    this.setState({ change: change });
    console.log("jaymin", this.state.change);
  }
  deleteRow(e) {
    console.log("fdgfd", e);
    if (e === true) {
      this.setState({ change: false });
    } else {
      this.setState({ change: true });
    }
  }
  render() {
    return (
      <div>
        <button onClick={(e) => this.deleteRow(this.state.change)}>
          Click Here!
        </button>
        {this.state.change ? (
          <h1></h1>
        ) : (
          <iframe
            src="https://stackoverflow.com/"
            width="540"
            height="450"
          ></iframe>
        )}
      </div>
    );
  }
}

export default iframe;
